column8:
水槽のフチに掛けるだけでスタートできる呼び水不要の外掛け式フィルターです。<Br><br>
水中ポンプ採用でとても静かな動作音！<BR>
大容量なのに見た目スッキリ！！<BR>
<BR>
高性能ろ過マットのトリプル効果でニゴリ、黄ばみ、臭いも一発吸着！！<BR><BR>

トリプル効果1：物理ろ過<BR>
・飼育水のゴミや残りエサ、魚のフンをろ過マットで取り除く物理ろ過。<br><br>
トリプル効果2：生物ろ過<br>
・生きたバクテリアで残りエサや魚のフンによって発生するアンモニア、亜硝酸を分解する生物ろ過。<br><br>
トリプル効果3：吸着ろ過<br>
・高性能活性炭で飼育水のニゴリ、黄ばみ、悪臭を吸着し取り除く吸着ろ過。<br><br>

淡水、海水両用です。<Br><Br>
<BR>

【サイズ】W120×D110×H160mm<BR><BR>
【適合するサイズ】<Br>
・水槽：小型水槽～40cm水槽クラスぐらい<Br>
・水容量：約25リットルクラスまでに対応<Br>
・水槽フレーム幅：約20mmまで対応<Br><Br>
<BR>
■交換ろ材<Br>
・F1/F2/X1/X2用活性炭マットA<br>
・ストレーナースポンジPF-01<br><Br><!-- 帯バナー(RMSは共通説明文大に入ってる)-->

